    def shortestBridge0(self, A):
        if A is None or 0 == len(A) or 0 == len(A[0]):
            return 0
        R, C = len(A), len(A[0])

        parents, parentDict = [[-1] * C for _ in range(R)], {}
        def getParentInfo():
            parents[0][0] = 0 if A[0][0] == 1 else -1
            for c in range(1, C):
                if A[0][c] == 1:
                    if A[0][c - 1] == 1:
                        parents[0][c] = parents[0][c - 1]
                    else:
                        parents[0][c] = c
            for r in range(1, R):
                if A[r][0] == 1:
                    if A[r - 1][0] == 1:
                        parents[r][0] = parents[r - 1][0]
                    else:
                        parents[r][0] = r * C
            for r in range(1, R):
                for c in range(1, C):
                    if A[r][c] == 1:
                        if A[r - 1][c] == 1 and A[r][c - 1] == 1:
                            parents[r][c] = min(parents[r - 1][c], parents[r][c - 1])
                            bigger = max(parents[r - 1][c], parents[r][c - 1])
                            if bigger != parents[r][c]:
                                parentDict[bigger] = parents[r][c]
                        elif A[r - 1][c] == 1:
                            parents[r][c] = parents[r - 1][c]
                        elif A[r][c - 1] == 1:
                            parents[r][c] = parents[r][c - 1]
                        else:
                            parents[r][c] = r * C + c
            #for parent in parents:
            #    print(parent)
            for p, pp in parentDict.copy().items():
                _p = pp
                while _p in parentDict:
                    _p = parentDict[_p]
                parentDict[p] = _p
            #print(parentDict)

        getParentInfo()

        def isValid(r, c):
            if r < 0 or c < 0 or R - 1 < r or C - 1 < c:
                return False
            return True

        def hasSameParent(parentNum, r, c):
            parentNum0, parentNum1 = parentNum, parents[r][c]
            while parentNum0 in parentDict:
                parentNum0 = parentDict[parentNum0]
            while parentNum1 in parentDict:
                parentNum1 = parentDict[parentNum1]
            return parentNum0 == parentNum1

        def bfs(curCnt, sr, sc):
            cnt, q, visited, startParentNum, dstParentNum = float('inf'), [(0, sr, sc)], set(), parents[sr][sc], -1
            for r in range(R):
                for c in range(C):
                    if parents[r][c] == startParentNum or hasSameParent(startParentNum, r, c):
                        visited.add((r, c))
            while q:
                _cnt, r, c = q.pop(0)
                #print('({}, {}) = {}'.format(r, c, _cnt))
                visited.add((r, c))
                for nr, nc in [(r - 1, c), (r + 1, c), (r, c - 1), (r, c + 1)]:
                    if (nr, nc) in visited or not isValid(nr, nc) or curCnt <= _cnt:
                        continue
                    if A[nr][nc] == 0:
                        q.append((_cnt + 1, nr, nc))
                    else:
                        if _cnt < cnt:
                            cnt, dstParentNum = _cnt, parents[nr][nc]
            return cnt, startParentNum, dstParentNum

        cnt, visitedParents = float('inf'), set()
        for r in range(R):
            for c in range(C):
                if A[r][c] == 1:
                    if parents[r][c] in visitedParents:
                        continue
                    curCnt, p0, p1 = bfs(cnt, r, c)
                    if curCnt == 1:
                        return 1
                    if curCnt < cnt:
                        cnt = curCnt
                        visitedParents.add(p1)
                        while p1 in parentDict:
                            p1 = parentDict[p1]
                            visitedParents.add(p1)
                        #print('sub result ({}, {}) = {}, {}, {}'.format(r, c, cnt, p0, p1))
        return cnt

