    #   runtime; 544ms, 11.99%
    #   memory; 13.6MB, 63.64%
    def shortestBridge(self, A):
        if A is None or 0 == len(A) or 0 == len(A[0]):
            return 0
        R, C = len(A), len(A[0])

        def isValid(r, c):
            if r < 0 or c < 0 or R - 1 < r or C - 1 < c:
                return False
            return True
        #print(R, C)
        #   give parent numbers
        parents = [[-1] * C for _ in range(R)]
        def getParentInfo():
            for r in range(R):
                for c in range(C):
                    if A[r][c] == 0 or -1 != parents[r][c]:
                        continue
                    #print('calculating ({}, {})'.format(r, c))
                    curNum = r * C + c
                    #if parents[r][c] != -1 and curNum != parents[r][c]:
                    #    parentDict[max(curNum, parents[r][c])] = min(curNum, parents[r][c])
                    #    continue
                    q, visited = [(curNum, r, c)], set()
                    while q:
                        pn, _r, _c = q.pop(0)
                        if (_r, _c) in visited:
                            continue
                        #print(_r, _c, q)
                        visited.add((_r, _c))
                        parents[_r][_c] = pn
                        for nr, nc in [(_r - 1, _c), (_r + 1, _c), (_r, _c - 1), (_r, _c + 1)]:
                            if not isValid(nr, nc) or (nr, nc) in visited or A[nr][nc] == 0:
                                continue
                            q.append((pn, nr, nc))

        getParentInfo()

        #for parent in parents:
        #    print(parent)
        #   get points by parent numbers
        pNumDict = defaultdict(list)
        for r in range(R):
            for c in range(C):
                if -1 == parents[r][c]:
                    continue
                isCheckable = False
                if r == 0:
                    if c == 0:
                        if A[r + 1][c] == 0 or A[r][c + 1] == 0:
                            isCheckable = True
                    elif c == C - 1:
                        if A[r + 1][c] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                    else:
                        if A[r + 1][c] == 0 or A[r][c + 1] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                elif r == R - 1:
                    if c == 0:
                        if A[r - 1][c] == 0 or A[r][c + 1] == 0:
                            isCheckable = True
                    elif c == C - 1:
                        if A[r - 1][c] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                    else:
                        if A[r - 1][c] == 0 or A[r][c + 1] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                else:
                    if c == 0:
                        if A[r - 1][c] == 0 or A[r + 1][c] == 0 or A[r][c + 1] == 0:
                            isCheckable = True
                    elif c == C - 1:
                        if A[r - 1][c] == 0 or A[r + 1][c] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                    else:
                        if A[r - 1][c] == 0 or A[r + 1][c] == 0 or A[r][c + 1] == 0 or A[r][c - 1] == 0:
                            isCheckable = True
                if isCheckable:
                    pNumDict[parents[r][c]].append((r, c))

        pNums, dist = sorted(pNumDict.keys()), float('inf')
        for i, pNum in enumerate(pNums):
            pis = pNumDict[pNum]
            for j in range(i + 1, len(pNums)):
                pjs = pNumDict[pNums[j]]
                #print(i, j, pis, pjs)
                for r0, c0 in pis:
                    for r1, c1 in pjs:
                        curDist = abs(r0 - r1) + abs(c0 - c1) - 1
                        if 1 == curDist:
                            #print(r0, c0, r1, c1)
                            return 1
                        dist = min(dist, curDist)
        return dist


